import React from "react";
import './home.css';
import Glasses from '../../assets/Glasses';

interface DarkProp {
    dark: boolean;
}

export default function Home(props:DarkProp) {
    const darkClassName = props.dark ? "dark" : "";
    return (
        <div className={`glasses-container ${darkClassName}`}>
            <Glasses animated={false} dark={props.dark}/>
        </div>
    )
};
